{'project_name': 'Orcasound - Listen for Whales', 'project_description': 'Orcasound is a network that connects live hydrophones (underwater microphones) monitoring the habitat of endangered orcas with citizen scientists, educational environmental non-profits, and machine learning algorithms. The web-based Orcasound app (launched November 1, 2018) makes it easy to listen for whales -- both for their amazing orca sounds and for noise that may be detrimental to them -- by using HTTP Live Streaming (and eventually MPEG-DASH). These formats optimize playback performance over a wide range of browser/device combinations within the Orcasound web-app that plays a live audio stream. [The backend is an Elixir app using the Phoenix framework. The Phoenix app serves a React app.] ', 'project_description_solution': 'The Orcasound app at live.orcasound.net enables citizen scientists to monitor the acoustic environment of the whales and report when they hear the orcas call, whistle, or click, or when they hear other interesting signals. At the same time, machine learning classifiers work on lossless uncompressed data that is also transmitted to AWS S3 buckets from each hydrophone. Synergy between human and machine detection and classification will not only facilitate basic research into the communication and echolocation systems of fish-eating killer whales and other local marine species, but also will enhance many other research and educational activities to help the orcas recover. 

Notifications from the app when orca sounds are detected support: direct conservation actions by the listeners; live-listening events and associated outreach activities at the educational facilities of Orcasound members; NOAA studies of orca health and diet; mitigation of human-caused noise -- like pile driving at Wash', 'project_description_actions': 'Thus, to help save the endangered southern resident killer whales, we need a wide spectrum of volunteers: developers (for software -- at the hydrophone node, in the app, and for real-time cloud-based data analysis), beta-tester citizen scientists, user researchers, designers, and data hackers. Hackathon challenges include: optimize low-latency audio data acquisition and the upload script on the Raspberry Pi to improve player performance in the app; prioritize key features for beta-testing and implement a cycle of testing and refining them; develop an administrative interface (login, CMS, detection moderation, notifications); integrate a map view of hydrophone locations into the UI; clarify and begin implementing machine learning architecture and data pipelines; test mechanisms for real-time analysis, including visualization of audio data as a spectrogram, annotations from human or machine classifications, and quantification of noise statistics.

